Доступность

Различают несколько видов скрытия элемента:

Полное скрытие — элемент не виден на экране, не доступен при навигации с
клавиатуры и не доступен скринридерам. Применяется, когда необходимо скрыть
элемент для всех. Это скрытие через display: none, visibility: hidden;
или атрибут hidden.
Визуальное — элемент не виден на экране, но доступен для управления с
клавиатуры и для экранных читалок. Применяется, когда необходимо сделать
элемент невидимым, но при этом взаимодействие с этим элементом оставить.
Например, скрытие нативных радиокнопок \ чекбоксов — если скрыть их через
display: none, то они не будут доступны читалкам \ скринридерам.
Это скрытие через технику visuallyhidden.
Семантическое скрытие — элемент виден на экране, но не доступен для
скринридеров. Применяется для скрытия презентационных элементов.
Например, если кнопка содержит в себе иконку, то скринридер не должен
зачитывать эту иконку (но при этом в кнопке должен быть атрибут title,
который содержит текстовое описание действия).
Это скрытие через атрибут aria-hidden="true".

/* Недопустимо */
input[type=radio] {
  display: none
}

/* Правильно */
input[type=radio] {
  @extend .visuallyhidden;
}


Семантическая и визуальная роли могут отличаться: визуально это может быть
кнопка, а семантически — ссылка. И наоборот. При разработке компонентов стоит
учитывать этот нюанс и сбрасывать все стандартные стили тегов, которыми этот
компонент может обладать.
/* Недопустимо */
.link {
  color: red;
}

/* Правильно */
.link {
  /* сброс всех свойств к значению по-умолчанию, */
  /* убирается различие между всеми тегами */
  all: initial;
  color: red;
}
.link {
  /* Сброс стандартных стилей  */
  background: none;
  border: 0;
  color: inherit;
  font: inherit;
  line-height: normal;
  overflow: visible;
  padding: 0;
  user-select: none;

  color: red;
}

CSS/Methodology/BEM.html.body:
БЭМ
БЭМ — основная методология, которая используется по умолчанию на всех проектах.
В терминологии БЭМ компонентом является сам блок, настраивается компонент через
модификаторы.
Сущности
Методология состоит из трех основных сущностей: блок, элемент и модификатор:

Блок — имя компонента, которое задает пространство имен для классов
элементов \ модификаторов.
Элемент — какая-то сущность внутри блока. Полное имя элемента cодержит в
качестве префикса имя блока. Например, .header__container — header — имя
блока, container — имя элемента.
__ — используется для разделения этих двух имен.
Модификатор — класс, который как-то дополняет или изменяет внешний вид или
поведение компонента. Модификатор может относиться либо к блоку целиком,
либо к отдельному элементу. Например, .header_size_big или
.header__container_size_big — полное имя модификатора содержит
имя блока \ элемента, затем разделитель _ и затем сам модификатор,
название (size) и значение (big). Модификатор может быть булевым, тогда
он содержит только название, например, .header_disabled или
.header__container_disabled.

Префикс необходим для изоляции имен классов между различными блоками — в
.header__container и .footer__container элемент имеет одно и тоже название,
но благодаря префиксу имена классов не будут пересекаться, для модификаторов
аналогично. Получаем, что уникальным должно быть только название блока.
Подробное описание методологии
Правила

Не допускается создание вложенных элементов. Допускается создание сложных
элементов в тех случаях, когда это одна-две обертки над исходным элементом,
которые необходимы для визуальной части. Например, .header__image-wrapper.
  /* Недопустимо */
  .block__element__subelement { ... }

  /* Допустимо */
  .block__element-subelement { ... }

  /* Правильно */
  .block__subelement { ... }


В случае наличия большого числа одинаковых элементов, которые связаны общим
смыслом и не являются визуальным обертками, стоит вынести таким элементы в
отдельный блок:
  /* Недопустимо */
  .header__user  { ... }
  .header__user-name { ... }
  .header__user-image-wrapper { ... }
  .header__user-image { ... }

  /* Правильно */
  .user  { ... }
  .user__name { ... }
  .user__image-wrapper { ... }
  .user-image { ... }


Модификатор должен решать только одну задачу. Для создания более сложных
видов используйте несколько независимых модификаторов. В будущем каждый из
них можно будет использовать по отдельности
/* Недопустимо */
.block { ... }
.block_color_important {
  color: red;
  border-radius: 10px;
  height: 50px
}  

/* Правильно */
.block { ... }
.block_color_important {
  color: red;
}
.block_rounded {
  border-radius: 10px;
}
.block_size_big {
  height: 50px
}


Используйте булевы модификаторы только в тех случаях, когда состояние
блока имеет только одно возможное значение и не предполагается других
сходных модификаторов.
/* Недопустимо */
.block { ... }
.block_big {
  /* big отвечает за размер. В будущем могут появится другие состояния, */
  /* который являются частью одной группы */
}  

/* Правильно */
.block { ... }
.block_size_big {
  /* Поместили big в группу модификаторов size, */
  /* который может принимать различные значения, */
  /* но каждый модификатор из группы отвечает именно за размер */
}  
.block_disabled {
  /* модификатор отвечает только за «заблокированность» элемента. */
  /* Она не предполагает других состояний кроме как */
  /* заблокировано \ разблокировано */
}

CSS/Methodology/CSSModules.html.body:
CSS Modules
Не является методологией, а является средством трансформации имен классов.
Возможно использование любой методологии вместе с CSS Modules.
Суть заключается в том, что на этапе сборки проекта, исходные имена классов в
селекторах как-то трансформируются и в собранном проекте получаются другие имена
классов. То, как именно трансформируются классы, зависит от настроек проекта, но
суть в том, чтобы одинаковые имена классов из разных файлов на выходе стали
разными именами.
Допустим, есть файлы a.css и и b.css. В каждом есть селектор .title. В
зависимости от настроек можно получить .a_title и .b_title — к исходному
имени класса добавляется имя файла + подчеркивание, такой режим часто
используется для разработки. Для готовой сборки можно настроить минификацию имен
и получить селекторы .aypdw и .pecdq.
Таким образом, решается одна из 2 основных проблем изоляции CSS — изоляция
селекторов, но необходимо контролировать вывод классов, если в разметке будет
, то работать стили не будут — имена отличаются. Поэтому,
чаще всего CSS Modules используется в React-приложениях, в которых есть полный
контроль за итоговой разметкой.
В CSSSR используется модифицированная версия БЭМ.
Поэтому актуальны большинство правил из БЭМ.
Правила

Не используйте префикс с именем блока у элементов. CSS Modules сами по себе
обеспечивают уникальность класса
/* Недопустимо */
.block { ... }
.block__element { ... }  

/* Правильно */
.block { ... }
.element { ... }


Используйте модификаторы, аналогичные модификаторам в БЭМ. Визуально понятно,
что класс является модификатором, в отличие от модификатора без префикса
/* Недопустимо */
.block { ... }
.disabled { ... }  

/* Правильно */
.block { ... }
.block_disabled { ... }


Не используйте сomposes для управления состояниями (модификаторами). Идея
composes в одном классе на элемент и состояние описывается целиком в классе.
Это ухудшает удобство использования различных состояний, когда групп таких
состояний несколько
/* Недопустимо */
.block { ... }
.block_disabled {
  composes: block;
  /* дополнительные стили */
}  
/*  */

/* Правильно */
.block { ... }
.block_disabled {
  /* дополнительные стили */
}  
/*  */

JavaScript/Readme.html.body:
JavaScript
Общее

Не используйте магические числа. Выносите все значения в именованые
константы, имя которых позволяет понять предназначение этого числа
или то, откуда оно взялось
/* Недопустимо */
setTimeout(callback, 86400000)

/* Правильно */
var MILLISECONDS_IN_DAY = 86400000
setTimeout(callback, MILLISECONDS_IN_DAY)



Условия

Используйте строгое сравнение (===), вместо ==.
Строгое сравнение не приводит оба операнда к одному типу,
что позволяет избежать ряда различных неочевидных проблем.
/* Недопустимо */
if (a == b) {
  ...
}

/* Правильно */
if (a === b) {
  ...
}


Если всё тело или большая часть тела функции содержится внутри
какого-либо if, то заменяйте условие на обратное и делайте
ранний выход из функции. Это позволяет уменьшить вложенность кода,
что делает его проще для чтения.
/* Недопустимо */
function fn(arg) {
  if (arg) {
   // ...
  }
}

/* Правильно */
function fn(arg) {
  if (!arg) {
    return
  }

  // ...
}


Избавляйтесь от условия, если ветки условия отличаются только каким-либо
булевым значением. Присвойте переменной само условие или его отрицание:
/* Недопустимо */
function fn1(arg) {
  if (argument === 5) {
    return true
  } else {
    return false
  }
}
function fn2(arg) {
  var needCheck

  if (argument === 5) {
    needCheck === false
  } else {
    needCheck === true
  }

  if (needCheck) {
    ...
  }

  ...
}

/* Правильно */
function fn1(arg) {
  return argument === 5
}
function fn2(arg) {
  var needCheck = argument !== 5 // обратное условие

  if (needCheck) {
    ...
  }

  ...
}


Избавляйтесь от условия, если в ветках содержится только присвоение значения
переменной. В таких случаях условие можно заменить на тернарный оператор.
/* Недопустимо */
function fn1(arg) {
  var a

  if (argument === 5) {
    a = 7
  } else {
    a = 8
  }
}
function fn2(arg) {
  var a = 8

  if (argument === 5) {
    a = 7
  }
}

/* Правильно */
function fn(arg) {
  var a = argument === 5 ? 7 : 8
}


Избавляйтесь от множественных условий, если проверки заключаются в проверке
какой-либо переменной на какое-то значение и если ветки содержат только
одно действие. Заменяйте условие на объект \ массив:
/* Недопустимо */
function fn1(arg) {
  var a

  if (arg === 0) {
    a = 5
  } else if (arg === 1) {
    a = 3
  } else if (arg === 2) {
    a = 4
  } else {
    a = 1
  }
}
function fn2(arg) {
  switch(arg) {
    case 'A':
      return someFunc1()
    case 'B':
      return someFunc2()
    case 'C':
      return someFunc3()
    default:
      return someDefaultFunc()
  }
}

/* Правильно */
function fn1(arg) {
  var values = [5, 3, 4]
  var a = values[arg] || 1
}
function fn2(arg) {
  var fnByArg = {
    A: someFunc1,
    B: someFunc2,
    C: someFunc3,
  }
  var fn = fnByArg[arg] || someDefaultFunc

  return fn()
}



Циклы, работа с коллекциями
Не используйте циклы. В большинстве случае они не нужны и заменяются
на map, filter, reduce и прочие методы. Стандартные методы работают
только с массивами, но есть отдельные библиотеки для работы с данными,
которые позволяются работать и с объектами — Lodash или Ramda.
В этих же библиотеках содержится множество полезных методов,
которые решают частовстречаемые задачи по работе с коллекциями.

Используйте map когда необходимо преобразовать один массив (или объект)
в другой одинаковой длины и когда каждому элементу исходного
массива соответствует один элемент из нового массива.
/* Недопустимо */
var newArr = []
for (var i = 0; i 

Используйте filter, когда нужно отфильтровать массив
по какому-либо критерию.
Аналогом метода filter для объектов является функция pickBy.
/* Недопустимо */
var newArr = []
for (var i = 0; i 

Используйте reduce для всех остальных преобразований.
Например, преобразовать массив в число или массив в объект.
/* Недопустимо */
var sum = 0
for (var i = 0; i 

Не используйте forEach в тех случаях, когда вы меняете какие-то значения
в глобальных переменных, объявленных ранее.
Такое преобразование, как правило, можно заменить на reduce.
/* Недопустимо */
var sum = 0
oldArr.forEach(function(item) {
  sum += item
})

/* Правильно */
var newArr = oldArr.reduce(function(acc, item) {
  return acc + item
})


Не используйте reduce в тех случаях, когда преобразование можно
записать через цепочку map и filter. Лучше использовать цепочку,
каждый элемент которой будет делать одну задачу.
/* Недопустимо */
var newArr = oldArr.reduce(function(acc, item) {
  if (item % 2 === 0) {
    return acc
  }

  var newItem = item * 2
  acc.push(newItem)
  return acc
}, [])

/* Правильно */
var newArr = oldArr
  .filter(function(item) {
    return item % 2 !== 0
  })
  .map(function(item) {
    return item * 2
  })



Функции

Создавайте функции, которые решают только одну задачу.
Обращайте внимание на цикломатическую сложность ваших функций.
Большое число указывает на то, что у функции есть много вариантов выполнения,
а значит такая функция сложна для чтения и понимания.
Делайте большинство функций чистыми — такими, которые получают все
необходимые данные через свои аргументы (то есть, они не берут никаких
данных из глобальных переменных) и которые только возвращают результат
(и никак не влияют на внешнее состояние). Такие функции, как правило,
более просты и понятны и их легче тестировать.

JavaScript/Testing.html.body:
Тестирование
Основная цель тестов — убедиться, что конечный продукт или какая-то его часть работают корректно. Помимо этого есть и другая польза:

Тесты выступают как документация. Если на какой-то случай есть тест,
значит поведение точно должно быть таким.
Например, если у функции деления при делении на ноль есть два варианта
работы: бросить исключение или вернуть бесконечность. Если теста нет,
то непонятно текущее поведение задумывалось или его просто забыли учесть.
Тесты упрощают рефакторинг — на текущий функционал уже написаны тесты,
а значит можно изменять внутреннюю реализацию, не боясь что-то сломать.
Во многих случаях тесты ускоряют (а не замедляют!) написание кода.
Причина в том, что во время написания кода нет необходимости
вручную проверять все возможные кейсы работы, чтобы убедиться,
что всё работает корректно.

Unit-тесты
Unit-тесты - это тесты, которые тестируют какой-то
один изолированный модуль — например, функцию или класс.
Наиболее легкотестируемыми являются чистые функции — функции,
которые не имеют сайд-эффектов, получают всё необходимое в своих аргументах и возвращают результат
каких-либо вычислений.
Основные преимущества в том, что такие функции не требуют для себя
какого-либо cпецифичного окружения — например, браузера.
А значит, что такие тесты проще запускать, и, так как внутри выполняются 
только вычисления, тест проходит быстро.
Сам юнит-тест представляет собой вызов функции и проверку на то,
что функция вернула какое-то определенное значение. Иными словами,
юнит-тест — это простое сравнение результата с каким-либо эталоном.
it('sums numbers', async () => {
  expect(sum(2, 5)).toEqual(7)
})

Проверять необходимо пограничные случаи, желательное и нежелательное поведение.
Например, для функции сложения это будут варианты:

сложение положительных чисел;
сложение с нулем;
сложение отрицательных чисел;
сложение дробных чисел.

Не стоит стремиться написать тесты на все возможные случаи. Если вы не протестируете кейс, который воспроизводится в одном случае на миллион, то просто сделаете это, когда баг будет найдет. Конечно же, если вы пишите медицинскую или финансовую систему, то стоит постараться исключить и такие баги, но так или иначе все проблемные места вы предсказать не сможете.
Оформлене тестов
Очень важно, как вы пишите тесты. Всегда придерживайтесь правила AAA (или 3A): Arrange, Act, Assert. Каждый ваш тест должен быть визуально разделен на три этапа:
it('calculates intersection of two vectors', async () => {
  // Arrange
  const vect1 = [...]
  const vect2 = [...]

  // Act
  const result = areVectorsIntersect(vect1, vect2)

  // Assert
  expect(result).toBeTrue()
})

Конечно, не всегда эти стадии стоит явно выделять в тесте. Если Arrange и Act являются крайне простыми, как в случае с тестом функции sum, то можно все три стадии записать в одной строке, в ином же случае стоит добавлять пробельную строку между ними для визуального выделения стадий.
Не выполняйте разные проверки в одном тесте:
// плохо
it('sums two numbers', async () => {
  expect(sum(10, 20)).toBe(30)
  expect(sum(-10, -20)).toBe(-30)
  expect(sum(-10, 20)).toBe(10)
  expect(sum(10, 20)).not.toBe(42)
})

// хорошо
it('sums two positive numbers', async () => {
  expect(sum(10, 20)).toBe(30)
})

it('sums two negative numbers', async () => {
  expect(sum(-10, -20)).toBe(-30)
})

it('sums a positive and a negative number', async () => {
  expect(sum(-10, 20)).toBe(10)
})

Если в одном из кейсов будет ошибка, то тест, проверяющий все сразу упадет, и не будет понятно, где именно случилась ошибка. Кроме того, бывают случаи, когда бизнес логика меняется и тесты необходимо менять/удалять. В случае с кучей проверок в одном тесте это может быть более проблематично, чем если бы мы делали это для отдельных тестов.
Старайтесь, чтобы описание вашего теста явно отражало, что именно вы проверяете, если ваша функция должна складывать числа, а вы проверяете что она корректно складывает отрицательное и положительное число, то напишите так: it('sums negative and positive numbers', () => { ... }), - при этом функция it должна начинать ваше описание так, чтобы получилась нормальная фраза на английском языке: it sums negative and positive numbers.
Не используйте слово should в описании теста. Оно не описывает то, что делает ваша функция, оно повторяется из теста в тест, что делает его ненужным для описания теста.
// плохо
it('should sum two positive numbers', async () => {
  expect(sum(10, 20)).toBe(30)
})

// хорошо
it('sums two positive numbers', async () => {
  expect(sum(10, 20)).toBe(30)
})

Таким образом вы избавляетесь от повторяющегося и неважного слова should, оставляя только важную часть описания.
Используйте describe не только для выделения того юнита, который вы тестируете, но и для выделения контекста тестирования. Допустим у нас есть некий компонент Block, он может находиться в двух состояниях: видимый и невидимый. Когда наш компонент видим, то он ведет себя одним образом, когда невидим - другим. Мы хотим проверить этом, для этого напишем несколько тестов:
describe('Block', () => {
  describe('when it is visible', () => {
    it('shows something', () => {})
    it('calculates own position', () => {})
  })

  describe('when it is invisible', () => {
    it('hides something', () => {})
    it('does not calculate own position', () => {})
  })
})

Таким образом наши проверки будут выполняться в двух явных контекстах:
Block
  when it is visible
    shows something
    calculates own position
  when it is invisible
    hides something
    does not calculate own position
Это позволяет избавиться от дублирования в описаниях тестов. Без объединения в блок контекста мы бы написали так:
// плохо
describe('Block', () => {
  it('when it visible it shows something', () => {})
  it('when it visible it calculates own position', () => {})
  it('when it invisible it hides something', () => {})
  it('when it invisible it does not calculate own position', () => {})
})

Тесты с блоками контекста проще читаются, легче найти нужный тест, а так же понять какой тест и при каких условиях упал.
Подготовка данных
Важно понимать, что каждый тест должен быть независимым от других тестов, поэтому в каждом отдельном тесте мы заново выполняем этап Arrange, даже если он выполнялся в предыдущих тестах. Не выносите подготовку данных в отдельную переменную, функцию или beforeEach, если данные, которые нужно подготовить, довольно просты:
// плохо
describe('Verification', () => {
  const data = {
    name: 'test',
    email: 'test',
  }

  describe('verifyName', () => {
    it('returns false if name is not valid', () => {
      expect(verifyName(data.name).toBeFalsy()
    })
  })

  describe('verifyEmail', () => {
    it('returns false if email is not valid', () => {
      expect(verifyEmail(data.email).toBeFalsy()
    })
  })
})

// хорошо
describe('Verification', () => {  
  describe('verifyName', () => {
    it('returns false if name is not valid', () => {
      expect(verifyName('test').toBeFalsy()
    })
  })

  describe('verifyEmail', () => {
    it('returns false if email is not valid', () => {
      expect(verifyEmail('test').toBeFalsy()
    })
  })
})

В первом случае, подготовка данных была вынесена в beforeEach, если тестов будет очень много и блок beforeEach не будет виден разработчику, то судя лишь по одному тесту он не сможет сказать, что проверяет этот тест. Во втором случае тесты полностью самодостаточны. Прочитав код теста можно однозначно сказать какие данные используются в тесте.
Помните, что читаемость теста важнее устранения дублирования, если это дублирование не мешает читаемости. Выносить Arrage в отдельную абстракцию стоит тогда, когда данные имеют сложную структуру и воспроизводить ее в каждом тесте становится неудобно, плюс когда эти данные раздувают тест, что делает его менее читаемым:
describe('Serializer', () => {
  const data = {
    name: 'test',
    age: 20,
    email: 'test',
    skills: ['programming', 'writing songs'],
    bestFriends: [
      { name: 'test1', ... },
      { name: 'test2', ... },
      { name: 'test3', ... },
    ],
  }

  describe('after serialization', () => {
    it('converts name into serialized name' () => {
      expect(serialize(data).name).toBe(...)
    })

    it('converts bestFriends into serialized bestFriends' () => {
      expect(serialize(data).bestFriends).toBe(...)
    })
  })
})

Здесь мы вынесли сложную инициализацию данных, чтобы сделать тесты более читаемыми
Интеграционные тесты
Интеграционные тесты - это тесты, которые в отличие от unit-тестов тестируют взаимодействие нескольких юнитов, проверяя их совместную работу. Задастую таким образом тестируется некий логический слой, например, http API или работа конкретного компонента.
По сути все правила описанные для unit-теста справедливы и для интеграционного теста, но в случае с интеграционным тестом добавляется необходимость мокировать (от англ. mock) зависимости тестируемой функциональности.
Например, мы хотим убедиться, что функция в определенных условиях отправит данные на сервер, а иначе бросит ошибку, но мы не хотим на самом деле отправлять данные на сервер, здесь нам поможет spy:
describe('for valid data', () => {
  it('sends data to a server', () => {
    spyOn(api, 'sendData')
    const expectedData = { /* то, что мы ожидаем получить в sendData */ }

    // представим, что данные в этой функции каким-то образом сериализуются,
    // а если данные невалидны, то сериалайзер выбрасывает ошибку
    parseAndSendData(api, validData)

    expect(api.sendData).toHaveBeenCalledWith(expectedData)  
  })
})

describe('for invalid data', () => {
  it('throws an error and does not call "sendData"', () => {
    spyOn(api, 'sendData')

    expect(() => parseAndSendData(api, invalidData)).toThrowError('some error')
    expect(api.sendData).not.toHaveBeenCalled()  
  })
})

Таким образом мы проверили, что наша функция отработает ожидаемым образом в необходимых для нас кейсах, но при этом не оправляли данные на сервер.
End to End тестирование (e2e)
Это тестирование непосредственно вашего приложения в том виде, в котором его видят ваши пользователи. В таком тестировании при проверке авторизации на сайте нам нужно будет выполнить именно авторизацию на сайте, кликая по кнопкам и заполняя формы, которые должен заполнять пользователь.
Это самый дорогой в плане реализации и поддержки вид тестов, но при этом он и самый эффективный. Такие тесты следует писать на наиболее важные части системы, либо же на устоявшиеся части системы. Если же вы напишите e2e-тест на постоянно меняющуюся часть, то вам придется тратить много времени на поддержку самого теста в актуальном состоянии. Кроме того, в этом случае у вас может быть много ложных срабатываний, что не отразится полжительно на скорости разработки проекта
Как начать писать тесты в legacy проекте
Часто бывает такое, что разработчики хотят писать тесты на своем проекте, понимают их пользу, но не пишут их по причине того, что проект старый и тестов там никогда не было.
Начните с интеграционных или e2e-тестов. Напишите тесты для наиболее важных частей вашего приложения. Даже если в вашем проекте очень высокая связанность между модулями, то вы все равно сможете без значительных изменений в коде написать высококоуровневые тесты.
Именно они позволят вам начать делать рефакторинг, выделяя тестируемые юниты, которые уже можно покрывать unit-тестами.
Заведите правило на проекте, что новый функционал и баги вы обязательно покрываете тестами.
Таким образом через некоторое время вы обнаружите, что ваш проект уже хорошо покрыт тестами.
Code Coverage
Покрытие кода — это метрика, которая показывает какое количество
кода было протестировано.
Покрытие может вычисляется по-разному:

покрытие операторов — каждая ли строчка выполнилась;
покрытие условий — каждая ли ветка функции была выполнена;
покрытие функций — каждая ли функция вызывалась.

Не стремитесь к 100% покрытию кода. Где-то на 70-80% покрытия цена на увеличение покрытия становится неоправданно высокой. Вы начинаете тратить слишком много сил на увеличение значения покрытия тестами, но при этом эффективность этих проверок практически не возрастает.
Так же 100% покрытие кода не гарантирует того, что модуль работает корректно.
Для покрытия линейной функции достаточно одного теста — все операторы
выполняться в этом тесте.
TDD
TDD — техника разработки, в которой сначала пишутся тесты, а затем
функция. Тесты пишутся только на какую-то небольшую часть функционала.
В целом процесс разработки выглядит так:

написать тест для проверки одного кейса разрабатываемого функционала;
запустить тесты и убедиться, что написанный тест не проходит;
написать минимально достаточный код для прохождения теста;
проверить, что проходят все тесты;
вернуться к первому шагу.

Следовать этой методике довольно сложно и не всегда эффективно. Всегда взвешивайте сложность реализуемого вами функционала, если вы пишите что-то типа функции sum, то ничего страшного не произойдет, если вы напишите сразу все тесты уже после реализации функции. Но если же вы делаете что-то сложное, то методика test first вам обязательно поможет.
Помните, что какую бы методику написания тестов вы не выбрали, главное - пишите тесты.

JavaScript/ESNext/ES2015.html.body:
ES2015
ES2015 внес огромное количество изменений.
Большая часть изменений — различный синтаксический сахар,
который позволяет писать код короче и проще.
const и let
Помимо объявления переменных через var, появился новый способ
объявления переменных через const и let
Отличия от var:

Область видимости таких переменных — блок, а не функция.
Переменные не всплывают наверх, попытка обращения к переменной до её
объявления выдаст ошибку (в случае с var обращение работает,
но значение будет undefined).

Отличие const от let cостоит в том, что значение переменной заданной
через const нельзя переназначить. Но его можно мутировать.
То есть, константным является не значение, а ссылка:
const a = [1, 2, 3];
a.push(4); // все ОК, мутировать значения допускается.
a = [4, 5, 6]; // ошибка, переназначить нельзя

Деструктуризация
Массивы

Появилась возможность присвоить содержимое массива нескольким
отдельным переменным, разбив его на часть.
var array = [1, 2, 3]
// ES5 и ранее
var first = array[0];
var second = array[1];
// ES2015 и позднее:
var [first, second] = array;


Если часть значений не нужна, то их можно игнорировать, оставив
пустое значение вместо имени переменной
var array = [1, 2, 3]
// ES5 и ранее
var first = array[0];
var third = array[2];
// ES2015 и позднее:
var [first, , third] = array;


Если нам нужно получить все последующие значения массива,
то можно использовать оператор spread
var array = [1, 2, 3];
// ES5 и ранее
var first = array[0];
var rest = array.slice(1);
// ES2015 и позднее:
var [first, ...rest] = array;


В деструктуризации можно задать значение по умолчанию
var array = [1, 2]
// ES5 и ранее
var third = array[2] === undefined ? 5 : array[2];
// ES2015 и позднее:
var [,,a = 5] = arr;


Деструктуризация может быть вложена друг в друга.
var array = [[1, 2], 3];
// ES5 и ранее
var one = array[0][0];
var two = array[0][1];
var three = array[1];
// ES2015 и позднее:
var [[one, two], three] = array;

Обратите внимание, что если нулевой элемент внешнего массива — не массив,
то будет ошибка (в обоих вариантах). Поэтому необходимо это учитывать
(например, через значение по умолчанию для нулевого элемента)


Объекты

Появилась возможность присвоить содержимое объекта нескольким
отдельным переменным, разбив его на часть.
Обратите внимание, что имя переменной совпадает с именем ключа объекта.
var object = {
  a: 1,
  b: 2,
}
// ES5 и ранее
var a = object.a;
var b = object.b;
// ES2015 и позднее:
var {a, b} = object;


Если имя ключа отличается от имени переменной,
то можно указать переменную через двоеточие после ключа
(аналогично тому, как происходит записывание в объект).
var object = {
  a: 1,
  b: 2,
}
// ES5 и ранее
var aProperty = object.a;
var bProperty = object.b;
// ES2015 и позднее:
var {a: aProperty, b: bProperty} = object;


Можно указывать значение по умолчанию для переменной:
var object = {
  a: 1,
}
// ES5 и ранее
var a = object.a === undefined ? 5 : object.a;
// ES2015 и позднее:
var {a = 5} = object;


Другое имя переменной и значение по умолчанию можно совмещать:
var object = {
  a: 1,
}
// ES5 и ранее
var aProperty = object.a === undefined ? 5 : object.a;
// ES2015 и позднее:
var {a: aProperty = 5} = object;


Деструктуризация объекта также может быть вложенной и
необходимо учитывать возможные ошибки.
var object = {
  a: {
    b: 1,
    c: 2,
  },
  d: 3
}
// ES5 и ранее
var b = object.a.b;
var c = object.a.c;
var d = object.d;
// ES2015 и позднее:
var {a: {b, c}, d} = object;


Spread оператор для объектов не входит в стандарт ES2015, но есть
отдельное предложение для этого

Функции

Появилась возможность задавать параметрам функции значения по умолчанию,
которые могут быть выражениями. Учитывайте, что значение по умолчанию
берется только когда аргумент равен undefined (передан явно или аргумент
не передан вообще). Если передано любое другое значение (включая null),
то значение по умолчанию не будет взято.
function example(index = 0, array = getDefaultArray()) {
  // ...
}


Можно использовать оператор spread вместо обращения к arguments.
Обратите внимание, что spread должен быть последним в списке аргументов.
Он не может быть в его середине.
function example(a, b, ...rest) {
  // ...
}


